import logo from './logo.svg';
import './App.css';
import Greeting from './components/pure/Greeting';

function App() {
  const nombre = "ismael"
  return (
    <div className="App">
      <header className="App-header">
        <img src={logo} className="App-logo" alt="logo" />
        <Greeting props={nombre} />
      </header>
    </div>
  );
}

export default App;
